import React, { useState } from 'react';
import axios from 'axios';

function ProfileUpdate() {
  const [formData, setFormData] = useState({
    name: '',
    mobile: '',
    dob: '',
    gender: '',
    address: '',
  });

  const handleChange = (e) => {
    setFormData({ ...formData, [e.target.name]: e.target.value });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    axios.put('http://localhost:8000/api/profile-update/', formData, {
      headers: {
        Authorization: `Bearer ${localStorage.getItem('token')}`
      }
    })
      .then(response => {
        alert('Profile updated successfully');
      })
      .catch(error => {
        console.error(error);
        alert('Error updating profile');
      });
  };

  return (
    <form onSubmit={handleSubmit}>
      <input type="text" name="name" placeholder="Name" onChange={handleChange} required />
      <input type="text" name="mobile" placeholder="Mobile" onChange={handleChange} required />
      <input type="date" name="dob" onChange={handleChange} required />
      <input type="text" name="gender" placeholder="Gender" onChange={handleChange} required />
      <textarea name="address" placeholder="Address" onChange={handleChange} required></textarea>
      <button type="submit">Update Profile</button>
    </form>
  );
}

export default ProfileUpdate;
